import axios from 'axios';

class ItemService {

  sendData(data) {
    axios.post('http://localhost:3001/items/add/post', {
      item: data
    })
    .then(function(response) {
      console.log(response);
    })
    .catch(function(error) {
      console.log(error);
    });
  }
}

export default ItemService;
